import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { Button } from 'reactstrap';
import Widget from './Widgets/widget';


class App extends Component {
  render() {
    return (

      <div className="App">
        <header className="App-header">
        <div className="container">
        <h1>DASHBOARD</h1>
          <img src={logo} className="App-logo" alt="logo" />


          <div className="row">

          <Button color="danger" className="col-10">HELLO</Button><b></b><b></b>
          <Button color="danger"className="col-10">SALUT </Button> <b></b>
          <Button color="danger"className="col-10">BONJOUR</Button>
          </div>

        <div className="row">  
          <Widget className="col-lg-2"/>
          <Widget className="col-lg-10"/>
                </div>

          <Widget/>
          <Widget/>




          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
          </div>
        </header>

      </div>
    );
  }
}

export default App;
